INSERT INTO `sanpham` (`sp_ma`, `sp_ten`, `tg_ma`, `nxb_ma`, `nn_ma`, `tl_ma`, `sp_kichthuoc`, `sp_sotrang`, `sp_hinhthuc`, `sp_gia`, `sp_soluongtonkho`, `sp_mota`, `sp_hinhanh`, `sp_giamgia`) VALUES
(1, 'Lịch sử Việt Nam bằng tranh: Trần Hưng Đạo', 3, 2, 1, 1, '24 x 19', 80, 'Bìa mềm', 120000, 15, 'Bộ sách Lịch sử Việt Nam bằng tranh kể chuyện lịch sử Việt Nam bằng một phong cách ngắn gọn, hấp dẫn, có hệ thống qua những câu chuyện và những bức tranh đẹp. Phiên bản mới này được tô màu rất công phu. Sách được chăm chút khâu thiết kế, với ruột và bìa đẹp, vừa hiện đại vừa đậm bản sắc Việt. Vó ngựa xâm lược và mộng bành trướng của giặc Nguyên Mông đã đặt Đại Việt trước thử thách tồn vong. Nhưng chính trong bối cảnh cam go ấy, lòng yêu nước của hoàng tộc, quan lại và nhân dân Đại Việt được dịp phát huy. Bên cạnh những kẻ sinh lòng phản trắc, Đại Việt bấy giờ không thiếu những tấm lòng trung quân ái quốc, mà nổi bật nhất chính là vị Quốc công Tiết chế Trần Hưng Đạo. Vì nước nhà gạt bỏ thù riêng, vì đại sự gạt đi hiềm khích, biết dùng người tài không màng chuyện cũ, tiến cử người tài chẳng màng xuất thân..., bên cạnh tài cầm quân thao lược làm nên một Hưng Đạo Vương văn võ song toàn, toàn tài vẹn đức được sử sách hết mực ngợi ca.', , 0);
INSERT INTO `sanpham` (`sp_ma`, `sp_ten`, `tg_ma`, `nxb_ma`, `nn_ma`, `tl_ma`, `sp_kichthuoc`, `sp_sotrang`, `sp_hinhthuc`, `sp_gia`, `sp_soluongtonkho`, `sp_mota`, `sp_hinhanh`, `sp_giamgia`) VALUES
(2, 'Nhật ký trong tù', 1, 1, 1, 9, '13 x 19', 291, 'Bìa mềm', 65000, 33, 'Nhật ký trong tù ( Ngục trung nhật ký ) là một tác phẩm văn học gồm 133 bài thơ bằng chữ Hán của Hồ Chí Minh viết từ ngày 29 tháng 8 năm 1942 đến ngày 10 tháng 9 năm 1943. Ngoài ra, phần cuối văn bản là bút ký đọc sách và đọc báo ghi chép tóm tắt những thông tin về quân sự và văn hóa mà Bác đọc được trên sách, báo. Nhật ký trong tù không chỉ ghi lại những cảnh sinh hoạt trong tù, mà còn có ý nghĩa tố cáo chế độ nhà tù khắc nghiệt của chính quyền Tưởng Giới Thạch. Ngày 1 tháng 10 năm 2012, Thủ tướng Chính phủ nước Cộng hòa Xã hội Chủ nghĩa Việt Nam đã ra quyết định công nhận bảo vật quốc gia cho tác phẩm Nhật ký trong tù.', , 0);
INSERT INTO `sanpham` (`sp_ma`, `sp_ten`, `tg_ma`, `nxb_ma`, `nn_ma`, `tl_ma`, `sp_kichthuoc`, `sp_sotrang`, `sp_hinhthuc`, `sp_gia`, `sp_soluongtonkho`, `sp_mota`, `sp_hinhanh`, `sp_giamgia`) VALUES
(3, 'Khúc hát của cây', 4, 5, 1, 8, '15.5 x 23.5', 329, 'Bìa mềm', 140000, 1224, 'Lấy thiên nhiên làm nhân vật trung tâm, qua tác phẩm này, Haskell đã để các loài cây cất lên tiếng nói của mình về Trái Đất, con người và mối quan hệ phụ thuộc của đôi bên. Cây xanh đại diện cho linh hồn của rừng, cho thấy cái quy luật nhân quả về sự phát triển của các sinh vật trong vũ trụ. Dưới góc nhìn sinh học, tự thân cây xanh đã mang vẻ đẹp thuần túy nhờ vào cấu trúc bên trong, cơ chế vận hành và sự liên kết của nó với các sinh thể tự nhiên khác, vẻ đẹp ấy còn ẩn chứa cả bề dày lịch sử và văn hóa, mang nặng ký ức của một thời đại, một bộ tộc hay đơn giản là lưu giữ truyền thống tốt đẹp của một gia đình...', , 0);
INSERT INTO `sanpham` (`sp_ma`, `sp_ten`, `tg_ma`, `nxb_ma`, `nn_ma`, `tl_ma`, `sp_kichthuoc`, `sp_sotrang`, `sp_hinhthuc`, `sp_gia`, `sp_soluongtonkho`, `sp_mota`, `sp_hinhanh`, `sp_giamgia`) VALUES
(4, 'Thở và thiền', 3, 5, 1, 7, '13 x 21', 216, 'Bìa mềm', 79200, 1297, 'Thở Và Thiền là tuyển tập những cái nhìn về thiền dưới nhiều góc độ của hơn 30 bậc thánh nhân và đạo sư trong lịch sử nhân loại. Thở Và Thiền cho chúng ta một cái nhìn đa dạng dưới các góc độ tôn giáo và tâm linh khác nhau, từ quan kiến của Đức Phật hàng ngàn năm trước cho đến quan niệm của các thiền sư hiện đại trong thế kỷ 20. Thông qua phân tích của các trào lưu tâm linh khác nhau, độc giả có cơ hội đối chiếu, cảm nhận và khám phá khoa học thiền bằng tư duy của chính mình. Hiểu thiền theo con đường thích ứng của bản thân và gặt hái nhiều lời khuyên quý báu từ kho tàng của những bậc đã thành tựu trên con đường giác ngộ.', , 0);
INSERT INTO `sanpham` (`sp_ma`, `sp_ten`, `tg_ma`, `nxb_ma`, `nn_ma`, `tl_ma`, `sp_kichthuoc`, `sp_sotrang`, `sp_hinhthuc`, `sp_gia`, `sp_soluongtonkho`, `sp_mota`, `sp_hinhanh`, `sp_giamgia`) VALUES
(5, 'Cây tiền', 5, 5, 1, 6, '14 x 20.5', 337, 'Bìa mềm', 132300, 2134, 'Cuốn sách dùng giọng kể thu hút cùng một câu chuyện lôi cuốn pha lẫn hài hước để truyền tải thông điệp chính: làm giàu không khó nếu bạn sẵn lòng làm việc hăng say và đủ can đảm vượt khỏi vùng an toàn. Toàn bộ nội dung xoay quanh câu chuyện của Jake – hấp dẫn và đầy cảm hứng, sau đó nhẹ nhàng rút ra những hiểu biết sâu sắc và các bước hành động thiết thực từ câu chuyện đó. Đây được xem như làn gió mới của cuốn sách Cây tiền, nếu đặt trong thể loại sách tài chính vốn bị rập khuôn là khô khan, thiếu hấp dẫn. Có thể xem cuốn sách là cẩm nang hữu ích với đầy những ý tưởng tuyệt vời để kiếm tiền, đồng thời là một quyển fiction cuốn hút, giúp bạn tận hưởng trong suốt quá trình đọc.', , 0);
INSERT INTO `sanpham` (`sp_ma`, `sp_ten`, `tg_ma`, `nxb_ma`, `nn_ma`, `tl_ma`, `sp_kichthuoc`, `sp_sotrang`, `sp_hinhthuc`, `sp_gia`, `sp_soluongtonkho`, `sp_mota`, `sp_hinhanh`, `sp_giamgia`) VALUES
(6, 'Từ điển muôn loài: Chúng mình thích bay lượn', 3, 5, 1, 3, '25 x 25', 32, 'Bìa mềm', 46500, 1018, 'Bạn có biết, ngoài các loài chim còn có những người bạn nhỏ khác thuộc nhóm thú, bò sát hoặc cá đều có khả năng bay lượn? Bạn có biết những bí mật của thế giới côn trùng không? Những người bạn bé nhỏ nhưng có dân số đông đúc nhất hành tinh. Nhiều điều thú vị đang chờ đợi bạn trong cuốn sách này. Hãy lật sách để làm quen và khám phá đời sống của những người bạn ấy nào! Đặc biệt, trong mỗi cuốn sách có các hình dán cực kì dễ thương của 14 người bạn mới quen.', , 0);
INSERT INTO `sanpham` (`sp_ma`, `sp_ten`, `tg_ma`, `nxb_ma`, `nn_ma`, `tl_ma`, `sp_kichthuoc`, `sp_sotrang`, `sp_hinhthuc`, `sp_gia`, `sp_soluongtonkho`, `sp_mota`, `sp_hinhanh`, `sp_giamgia`) VALUES
(7, 'Cho tôi xin một vé đi tuổi thơ', 6, 2, 1, 3, '13 x 20', 208, 'Bìa cứng', 175000, 8, 'Trong Cho Tôi Xin Một Vé Đi Tuổi Thơ, nhà văn Nguyễn Nhật Ánh mời người đọc lên chuyến tàu quay ngược trở lại thăm tuổi thơ và tình bạn dễ thương của 4 bạn nhỏ. Những trò chơi dễ thương thời bé, tính cách thật thà, thẳng thắn một cách thông minh và dại dột, những ước mơ tự do trong lòng… khiến cuốn sách có thể làm các bậc phụ huynh lo lắng rồi thở phào. Không chỉ thích hợp với người đọc trẻ, cuốn sách còn có thể hấp dẫn và thực sự có ích cho người lớn trong quan hệ với con mình.', , 20);
INSERT INTO `sanpham` (`sp_ma`, `sp_ten`, `tg_ma`, `nxb_ma`, `nn_ma`, `tl_ma`, `sp_kichthuoc`, `sp_sotrang`, `sp_hinhthuc`, `sp_gia`, `sp_soluongtonkho`, `sp_mota`, `sp_hinhanh`, `sp_giamgia`) VALUES
(8, 'Dế Mèn phiêu lưu ký', 2, 1, 1, 2, '24 x 32', 112, 'Bìa cứng', 300000, 20, 'Trong hơn nửa thế kỉ kể từ ngày ra mắt bạn đọc lần đầu tiên năm 1941, Dế Mèn Phiêu Lưu Ký là một trong những sáng tác tâm đắc nhất của nhà văn Tô Hoài. Tác phẩm đã được tái bản nhiều lần, được dịch ra hơn 20 thứ tiếng trên thế giới và luôn được các thế hệ độc giả nhỏ tuổi đón nhận. Tác phẩm đã được xuất bản với nhiều hình thức khác nhau. Trong đó cuốn Dế Mèn Phiêu Lưu Ký gồm nhiều minh hoạ sinh động của hoạ sĩ Tạ Huy Long - một hoạ sĩ chuyên vẽ cho sách thiếu nhi. Bằng cách sử dụng màu nước điêu luyện, hoạ sĩ Tạ Huy Long đã làm sống động thêm tác phẩm bất hủ này của nhà văn Tô Hoài. Cuốn sách vì vậy sẽ là món quà đẹp cả về hình thức lẫn nội dung, là món quà ý nghĩa và bổ ích mà các bậc phụ huynh tặng cho những em bé ngoan của mình.', , 30);
INSERT INTO `sanpham` (`sp_ma`, `sp_ten`, `tg_ma`, `nxb_ma`, `nn_ma`, `tl_ma`, `sp_kichthuoc`, `sp_sotrang`, `sp_hinhthuc`, `sp_gia`, `sp_soluongtonkho`, `sp_mota`, `sp_hinhanh`, `sp_giamgia`) VALUES
(9, 'Thần thoại Hy Lạp', 7, 6, 1, 2, '16 x 24', 1030, 'Bìa mềm', 329200, 8, 'Thần thoại Hy Lạp, một di sản văn hóa của nhân dân Hy Lạp, từ lâu đã trở thành một giá trị phổ biến vô cùng quý báu của gia tài văn hóa nhân loại. Trong nền văn hóa nhân loại, từ những bức vẽ, bức tượng của các nghệ sĩ thời cổ đại, thời Phục Hưng, thế kỷ thứ XVII, thế kỷ XVIII, thế kỷ XIX và cả thế kỷ XX của chúng ta nữa cho đến một tập khảo luận, một vở kịch, một cuốn truyện, đều đã khai thác đề tài, cốt truyện, nhân vật, sự việc trong thần thoại Hy Lạp. Trong văn chương, trên báo chí, những thành ngữ, điển tích từ thần thoại Hy Lạp được sử dụng phổ biến như một thứ tín hiệu quen thuộc.', , 40);
INSERT INTO `sanpham` (`sp_ma`, `sp_ten`, `tg_ma`, `nxb_ma`, `nn_ma`, `tl_ma`, `sp_kichthuoc`, `sp_sotrang`, `sp_hinhthuc`, `sp_gia`, `sp_soluongtonkho`, `sp_mota`, `sp_hinhanh`, `sp_giamgia`) VALUES
(11, 'Nobita ở xứ sở nghìn lẻ một đêm', 8, 1, 1, 3, '13 x 18', 244, 'Bìa mềm', 50000, 15, 'Nobita Ở Xứ Sở Nghìn Lẻ Một Đêm là tác phẩm thứ 12 trong loạt phim hoạt hình rất được mến mộ “Doraemon” được chuyển thể từ nguyên tác truyện tranh của tác giả Fujko.F.Fujio. Câu chuyện lần này lấy bối cảnh là thế giới “Nghìn lẻ một đêm” mà tôi vô cùng yêu thích từ khi còn nhỏ. Suốt một thời gian dài, tôi đã ấp ủ dự định lồng ghép thế giới hư cấu đầy bí ẩn này vào trong thể loại truyện tranh. Và bây giờ, mời các em cùng tham gia chuyến phiêu lưu  tới xứ sở phép thuật của nhóm bạn Doraemon!', , 5);
INSERT INTO `sanpham` (`sp_ma`, `sp_ten`, `tg_ma`, `nxb_ma`, `nn_ma`, `tl_ma`, `sp_kichthuoc`, `sp_sotrang`, `sp_hinhthuc`, `sp_gia`, `sp_soluongtonkho`, `sp_mota`, `sp_hinhanh`, `sp_giamgia`) VALUES
(12, 'The Near Witch', 9, 13, 2, 2, '13 x 19.8', 320, 'Bìa cứng', 508000, 9, 'The Near Witch là một câu chuyện cổ được kể để làm trẻ em sợ hãi. Nếu gió gọi về đêm, bạn không được nghe. Gió cô đơn, và luôn tìm kiếm bạn đồng hành. Không có người lạ ở thị trấn Near. Đây là những sự thật mà Lexi đã nghe cả đời. Nhưng khi một người xa lạ thực sự, một chàng trai dường như tàn phai như khói, xuất hiện bên ngoài nhà cô vào buổi tối, cô biết rằng ít nhất một trong những câu nói này không còn đúng nữa. Đêm hôm sau, những đứa trẻ của thị trấn Near bắt đầu biến mất khỏi giường của chúng và cậu bé bí ẩn bị nghi ngờ. Khi cuộc săn lùng bọn trẻ ngày càng gia tăng, Lexi cũng cần biết về mụ phù thủy, điều có thể không chỉ là một câu chuyện trước khi đi ngủ, về cơn gió dường như có thể nói xuyên qua các bức tường vào ban đêm và về lịch sử của cậu bé vô danh này. Một phần câu chuyện cổ tích, một phần câu chuyện tình yêu, cuốn tiểu thuyết đầu tay của Victoria Schwab hoàn toàn là nguyên bản nhưng vẫn quen thuộc đến nhức nhối: một bài hát bạn đã nghe từ lâu, một lời thì thầm của gió và một giấc mơ không bao lâu nữa bạn sẽ quên.', , 5);
INSERT INTO `sanpham` (`sp_ma`, `sp_ten`, `tg_ma`, `nxb_ma`, `nn_ma`, `tl_ma`, `sp_kichthuoc`, `sp_sotrang`, `sp_hinhthuc`, `sp_gia`, `sp_soluongtonkho`, `sp_mota`, `sp_hinhanh`, `sp_giamgia`) VALUES
(14, 'Harry Potter and the Half-Blood Prince - Slytherin Edition', 10, 14, 2, 2, '16 x 24', 560, 'Bìa cứng', 329000, 5, 'Phiên bản Slytherin Edition này tôn vinh nhân vật cao quý của ngôi nhà Hogwarts nổi tiếng với lòng kiêu hãnh, tham vọng và sự xảo quyệt. Năm thứ sáu của Harry tại Hogwarts với nhiều khoảnh khắc và nhân vật tuyệt vời hơn của Slytherin - đặc biệt là việc Giáo sư Slughorn trở lại Hogwarts và tiết lộ quá khứ của Tom Riddle. Mỗi phiên bản Slytherin Edition đều có các cạnh được phun màu rực rỡ và lớp giấy bạc phức tạp. Thiết kế trang bìa tuyệt đẹp có một bức chân dung theo phong cách khách mời của Hoàng tử lai làm biểu tượng trung tâm, được đóng khung bởi hình tượng tuyệt đẹp theo chủ đề ngôi nhà. Ngoài phần giới thiệu riêng, Slytherin Edition còn có các hình minh họa mới của người đoạt Huy chương Kate Greenaway, Levi Pinfold, bao gồm cả bức chân dung của Draco Malfoy, sinh viên Slytherin đầy kiêu hãnh, và hình ảnh xúc động về một Severus Snape trẻ tuổi đang học Chế tạo Thuốc nâng cao để đi kèm với một tính năng trên những cuốn sách ma thuật.', , 0);
INSERT INTO `sanpham` (`sp_ma`, `sp_ten`, `tg_ma`, `nxb_ma`, `nn_ma`, `tl_ma`, `sp_kichthuoc`, `sp_sotrang`, `sp_hinhthuc`, `sp_gia`, `sp_soluongtonkho`, `sp_mota`, `sp_hinhanh`, `sp_giamgia`) VALUES
(15, 'Một nửa đích thực', 12, 12, 1, 2, '15.5 x 24', 406, 'Bìa mềm', 199000, 10, 'Bấy lâu nay, kiếm tìm một người tri kỷ, mảnh ghép hoàn hảo của cuộc đời ta vốn không phải điều dễ dàng. Nhưng giờ đây, nhờ một khám phá khoa học mới, chỉ một xét nghiệm gene đơn giản đã có thể đảm bảo bất cứ ai cũng có thể tìm thấy \"một nửa đích thực\", mà không phải trải qua những cuộc tình tan vỡ với đối tượng không phù hợp. Hàng triệu người trên thế giới đã chọn cách này, trong đó có Mandy, Christopher, Jade, Nick và Ellie. Tất thảy đều tin rằng mình đã tìm được tình yêu vĩ đại, người có thể đồng hành cùng họ đến cuối cuộc đời. Nhưng liệu mọi chuyện có đơn giản như vậy, khi ngay cả những người tri kỷ cũng có thể cất giấu những bí mật kinh hoàng? Một Nửa Đích Thực sẽ khiến bạn không khỏi băn khoăn liệu di truyền có thể thực sự quyết định tình yêu và liệu một câu chuyện như vậy có thể xảy ra trong tương lai.', , 0);

